export default function video() {
    return (
        <div className="video-container">
            <img 
            src="https://i.ytimg.com/vi/1q6ws2CcLHU/hq720.jpg?sqp=-oaymwEcCNAFEJQDSFXyq4qpAw4IARUAAIhCGAFwAcABBg==&rs=AOn4CLCG-v-SOfiAJIDyJlI3n3mIMogvQw" 
            alt="9 advanced tips of layout & composition in Web Design" 
            className="video-img" />
            <div className="video-info">
                <div className="channel-image-container">
                    img.
                </div>
            </div>
        </div>
    )
}
